from typing import List
from collections import defaultdict

class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        def binary_search(left, right, target):
            while left <= right:
                mid = (left + right) // 2
                if nums[mid] == target:
                    return mid
                if nums[mid] > target:
                    right = mid - 1
                else:
                    left = mid + 1
            return None

        def twoSum(index, target):
            result_list = []
            for i in range(index + 1, len(nums)):
                x = target - nums[i]
                ans = binary_search(i + 1, len(nums) - 1, x)
                if ans:
                    result_list.append([nums[i], x])
            return result_list
            # hash_map = defaultdict(int)
            # result_list = []
            # for i in range(index + 1, len(nums)):
            #     x = target - nums[i]
            #     if x in hash_map:
            #         result_list.append([nums[i], x])
            #     hash_map[nums[i]] = i
            # return result_list

        nums.sort()
        output = set()
        output_hash_map = defaultdict(int)
        for index in range(len(nums)):
            if nums[index] in output_hash_map:
                continue
            x = -nums[index]
            result = twoSum(index, x)
            if len(result) > 0:
                output_hash_map[nums[index]] = 1
                for r in result:
                    arr = [nums[index], *r]
                    arr.sort()
                    output.add(tuple(arr))
        return list(output)

